import './App.css';
import TopBar from './components/TopBar';
import Cover from './components/Cover';
import Intro from './components/Intro';

function App() {
  return (
      <div className="App">
          <TopBar />

          <div className="section">
              {<Cover />}
          </div>

          <div className="section">
              {<Intro />}
          </div>

          {/* Add more sections as needed */}
      </div>
  );
}

export default App;
